INSERT INTO `stage` (`stage_id`, `name`, `photo`, `district`, `description`) VALUES
(1, 'Freedom', 'data:image/jpeg;base64,', 'Spinningfields', 'Experience the pulsating beat of the city at the Spinningfields Stage, situated in the heart of Manchester\'s dynamic district. This electrifying stage sets the scene for an unforgettable fusion of urban energy and musical rhythm. Immerse yourself in a vibrant atmosphere as talented artists take the stage, delivering captivating performances across a variety of genres. From hip-hop to electronic beats, soulful melodies to energetic pop, the Spinningfields Stage brings together a diverse lineup that will ignite your senses and make you move to the rhythm. Let the dynamic ambiance of Spinningfields Stage transport you to the heart of the city\'s musical pulse, as you discover a melting pot of sounds that will leave you exhilarated and craving for more.');
INSERT INTO `stage` (`stage_id`, `name`, `photo`, `district`, `description`) VALUES
(2, 'The Rose Garden', 'data:image/jpeg;base64,', 'Chinatown', 'Welcome to the vibrant Chinatown Stage, nestled in the heart of Manchester. Immerse yourself in an enchanting fusion of Asian culture and music, as this captivating stage showcases the rich tapestry of melodies from across the continent. Get ready to be transported to a world of captivating sounds, rhythmic beats, and mesmerizing performances that celebrate the diversity and beauty of Asian musical traditions. From traditional tunes to contemporary interpretations, the Chinatown Stage promises an unforgettable musical experience that will captivate your senses and leave you with lasting memories. Join us in Chinatown and let the melodies whisk you away on an unforgettable journey through Asian musical heritage.');
INSERT INTO `stage` (`stage_id`, `name`, `photo`, `district`, `description`) VALUES
(3, 'Elixir', 'data:image/jpeg;base64,', 'Old Trafford', 'Welcome to the legendary Old Trafford Stage, an iconic venue that embodies the spirit of Manchester\'s rich musical heritage. Nestled in the heart of the city, this historic stage has witnessed countless unforgettable performances that have left an indelible mark on music history. Prepare to be mesmerized as the Old Trafford Stage showcases a lineup of renowned artists, delivering powerhouse performances that ignite the crowd with their raw talent and magnetic presence. From rock anthems to soul-stirring ballads, this hallowed stage radiates an electric energy that resonates with every note. Join us at the Old Trafford Stage, where music legends are born and where you\'ll experience the magic of live performances that will stir your soul and create memories to last a lifetime.');
INSERT INTO `stage` (`stage_id`, `name`, `photo`, `district`, `description`) VALUES
(4, 'Youphoria', 'data:image/jpeg;base64,', 'Castlefield', 'Discover the captivating Castlefield Stage, nestled within the charming and historic Castlefield district of Manchester. This unique stage offers a harmonious blend of music and history, creating an enchanting setting for unforgettable performances. Set against the backdrop of picturesque canals and industrial heritage, the Castlefield Stage transports you to a bygone era while showcasing an eclectic mix of musical genres. From acoustic melodies that echo through the cobblestone streets to energetic performances that reverberate through the old brick arches, the Castlefield Stage captivates audiences with its intimate and authentic ambiance. Immerse yourself in the soulful tunes and magnetic performances at this extraordinary stage, where the past and present intertwine to create a truly magical musical experience.');

